import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import ServiceList from './components/ServiceList';
import MasterList from './components/MasterList';
import Login from './components/Login';
import Register from './components/Register';
import AddService from './components/AddService';
import AddMaster from './components/AddMaster';
import { AuthContext } from './context/AuthContext';

const App = () => {
  const { isAuthenticated } = useContext(AuthContext);

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/services" element={<ServiceList />} />
        <Route path="/masters" element={<MasterList />} />
        <Route path="/add-service" element={isAuthenticated ? <AddService /> : <Login />} />
        <Route path="/add-master" element={isAuthenticated ? <AddMaster /> : <Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
};

export default App;
